                  "nav footer"`}
    gridTemplateRows={'50px 1fr 5px'}
    gridTemplateColumns={'150px 1fr'}
    gap='1'
    color='blackAlpha.700'
    fontWeight='bold'
    >
        <GridItem bg='orange.300' area={'header'}>

        </GridItem>
        <GridItem >
            <Form />
        </GridItem>
        <GridItem bg='green.300' >
            <ListOfBooks />
        </GridItem>
        <GridItem bg='blue.300' area={'footer'}>
            Footer
        </GridItem>
    </Grid>
    )
}


export default Home;
